<?php

class PayPal extends Payment implements iPayment {

    const RECEIVER_EMAIL = 'tetven@gmail.com';

    public function getLogo() {
        return 'data:image/png;base64,';
    }

    public function getUrl() {
        return 'www.paypal.com';
    }

    public function getName() {
        return 'PayPal';
    }

    public function getMethod() {
        return 'post';
    }

    public function getAction() {
        return 'https://www.paypal.com/cgi-bin/webscr';
    }

    public function getFormName() {
        return '_xclick';
    }

    public function getParams(PaymentHistory $history) {
        return array(
            'cmd' => '_xclick',
            'charset' => 'utf-8',
            'business' => self::RECEIVER_EMAIL,
            'item_name' => CHtml::encode(Yii::app()->name . '. ' . $history->getDescription()),
            'amount' => $history->amount,
            'no_shipping' => 1,
            'quantity' => 1,
            'currency_code' => 'USD',
            'email' => $history->user->email,
            'custom' => $history->id,
            'return' => Yii::app()->createAbsoluteUrl('/credits/paypal/notify', array('status' => 'complete')),
            'cancel_return' => Yii::app()->createAbsoluteUrl('/site/index'),
            'notify_url' => Yii::app()->createAbsoluteUrl('/credits/paypal/notify'),
        );
    }

    public function checkSign() {
        return TRUE;
        $req = 'cmd=' . urlencode('_notify-validate');
        foreach ($this->request as $key => $value) {
            $value = urlencode(stripslashes($value));
            $req .= "&$key=$value";
        }

        $ch = curl_init();
        curl_setopt($ch, CURLOPT_URL, $this->getAction());
        curl_setopt($ch, CURLOPT_HEADER, 0);
        curl_setopt($ch, CURLOPT_POST, 1);
        curl_setopt($ch, CURLOPT_RETURNTRANSFER, 1);
        curl_setopt($ch, CURLOPT_POSTFIELDS, $req);
        curl_setopt($ch, CURLOPT_SSL_VERIFYPEER, 1);
        curl_setopt($ch, CURLOPT_SSL_VERIFYHOST, 2);
        curl_setopt($ch, CURLOPT_HTTPHEADER, array('Host: ' . $this->getUrl()));
        $res = curl_exec($ch);
        curl_close($ch);

        if (strcmp($res, "VERIFIED") == 0) {
            if ($this->request['mc_currency'] == 'USD' && $this->request['payment_status'] == 'Completed' && $this->request['receiver_email'] == self::RECEIVER_EMAIL && $this->request['custom']) {
                return TRUE;
            }
        }
        return FALSE;
    }

    public function setResult() {
        
    }

    public function setSuccess() {
        
    }

    public function getScenario() {
        return 'paypal';
    }

}
